Book Title: The Picture of Dorian Gray

Book Author: Oscar Wilde

Paragraph: (1) It was silly of me to come down here at all. (2) I think I shall send a wire to Harvey to have the yacht got ready. (3) On a yacht one is safe.”

“Safe from what, Dorian? (4) You are in some trouble. (5) Why not tell me what it is? (6) You know I would help you.”

“I can’t tell you, Harry,” he answered sadly. (7) “And I dare say it is only a fancy of mine. (8) This unfortunate accident has upset me. (9) I have a horrible presentiment that something of the kind may happen to me.”



“What nonsense!”



“I hope it is, but I can’t help feeling it. (10) Ah! (11) here is the duchess, looking like Artemis in a tailor-made gown. (12) You see we have come back, Duchess.”

“I have heard all about it, Mr. Gray,” she answered. (13) “Poor Geoffrey is terribly upset. (14) And it seems that you asked him not to shoot the hare. (15) How curious!”

“Yes, it was very curious. (16) I don’t know what made me say it. (17) Some whim, I suppose. (18) It looked the loveliest of little live things. (19) But I am sorry they told you about the man. (20) It is a hideous subject.”

“It is an annoying subject,” broke in Lord Henry. (21) “It has no psychological value at all. (22) Now if Geoffrey had done the thing on purpose, how interesting he would be! (23) I should like to know some one who had committed a real murder.”



“How horrid of you, Harry!” cried the duchess. (24) “Isn’t it, Mr. Gray? (25) Harry, Mr. Gray is ill again.

