Paragraph: (1) I am quite sure he had no idea of what you meant.”



I had expected Poirot to be disappointed; but, to my surprise, he replied that that was as he had thought, and that he was very glad. (2) My pride forbade me to ask any questions. (3) Poirot switched off on another tack. (4) “Mademoiselle Cynthia was not at lunch to-day? (5) How was that?”

“She is at the hospital again. (6) She resumed work to-day.”

“Ah, she is an industrious little demoiselle. (7) And pretty too. (8) She is like pictures I have seen in Italy. (9) I would rather like to see that dispensary of hers. (10) Do you think she would show it to me?”

“I am sure she would be delighted. (11) It’s an interesting little place.”

“Does she go there every day?”



“She has all Wednesdays off, and comes back to lunch on Saturdays. (12) Those are her only times off.”

“I will remember. (13) Women are doing great work nowadays, and Mademoiselle Cynthia is clever—oh, yes, she has brains, that little one.”



“Yes. (14) I believe she has passed quite a stiff exam.”

“Without doubt. (15) After all, it is very responsible work. (16) I suppose they have very strong poisons there?”

“Yes, she showed them to us. (17) They are kept locked up in a little cupboard. (18) I believe they have to be very careful. (19) They always take out the key before leaving the room.”



“Indeed. (20) It is near the window, this cupboard?”

“No, right the other side of the room. (21) Why?”

Poirot shrugged his shoulders. (22) “I wondered. (23) That is all. (24) Will you come in?”

We had reached the cottage. (25) “No.

