Paragraph: (1) "What is it?". (2) I repeated, and for the first time during our acquaintance I kissed her hand. (3) "No, it's nothing, nothing," she said quickly. (4) "Oh, it's nothing, nothing.... Go away.... You see, I am not dressed.". (5) I went out overwhelmed. (6) The calm and serene mood in which I had been for so long was poisoned by compassion. (7) I had a passionate longing to fall at her feet, to entreat her not to weep in solitude, but to share her grief with me, and the monotonous murmur of the sea already sounded a gloomy prophecy in my ears, and I foresaw fresh tears, fresh troubles, and fresh losses in the future. (8) "What is she crying about? (9) What is it?". (10) I wondered, recalling her face and her agonised look. (11) I remembered she was with child. (12) She tried to conceal her condition from other people, and also from herself. (13) At home she went about in a loose wrapper or in a blouse with extremely full folds over the bosom, and when she went out anywhere she laced herself in so tightly that on two occasions she fainted when we were out. (14) She never spoke to me of her condition, and when I hinted that it might be as well to see a doctor, she flushed crimson and said not a word. (15) When I went to see her next time she was already dressed and had her hair done. (16) "There, there," I said, seeing that she was ready to cry again. (17) "We had better go to the sea and have a talk.". (18) "I can't talk. (19) Forgive me, I am in the mood now when one wants to be alone. (20) And, if you please, Vladimir Ivanitch, another time you want to come into my room, be so good as to give a knock at the door.". (21) That "be so good" had a peculiar, unfeminine sound. (22) I went away. (23) My accursed Petersburg mood came back, and all my dreams were crushed and crumpled up like leaves by the heat. (24) I felt I was alone again and there was no nearness between us. (25) I was no more to her than that cobweb to that palm-tree, which hangs on it by chance and which will be torn off and carried away by the wind.



