And with these she tried to get the case open. (12) “Let me do it,” said Peter, thinking he could do it better himself. (13) Everyone thinks this when he sees another person stirring a fire, or opening a box, or untying a knot in a bit of string. (14) “You'll hurt your hands, Mammy,” said Roberta; “let me.”



“I wish Father was here,” said Phyllis; “he'd get it open in two shakes. (15) What are you kicking me for, Bobbie?”

“I wasn't,” said Roberta. (16) Just then the first of the long nails in the packing-case began to come out with a scrunch. (17) Then a lath was raised and then another, till all four stood up with the long nails in them shining fiercely like iron teeth in the candle-light. (18) “Hooray!” said Mother; “here are some candles—the very first thing! (19) You girls go and light them. (20) You'll find some saucers and things. (21) Just drop a little candle-grease in the saucer and stick the candle upright in it.”



“How many shall we light?”



“As many as ever you like,” said Mother, gaily. (22) “The great thing is to be cheerful. (23) Nobody can be cheerful in the dark except owls and dormice.”



So the girls lighted candles. (24) The head of the first match flew off and stuck to Phyllis's finger; but, as Roberta said, it was only a little burn, and she might have had to be a Roman martyr and be burned whole if she had happened to live in the days when those things were fashionable. (25) Then, when the dining-room was lighted by fourteen candles, Roberta fetched coal and wood and lighted a fire.



