And then, as so often before, the gay children dragged him from his tree. (10) As so often before, but never again. (11) He had brought nuts for the boys as well as the correct time for Wendy. (12) “Peter, you just spoil them, you know,” Wendy simpered. (13) “Ah, old lady,” said Peter, hanging up his gun. (14) “It was me told him mothers are called old lady,” Michael whispered to Curly. (15) “I complain of Michael,” said Curly instantly. (16) The first twin came to Peter. (17) “Father, we want to dance.”

“Dance away, my little man,” said Peter, who was in high good humour. (18) “But we want you to dance.”

Peter was really the best dancer among them, but he pretended to be scandalised. (19) “Me! (20) My old bones would rattle!”

“And mummy too.”



“What,” cried Wendy, “the mother of such an armful, dance!”



“But on a Saturday night,” Slightly insinuated. (21) It was not really Saturday night, at least it may have been, for they had long lost count of the days; but always if they wanted to do anything special they said this was Saturday night, and then they did it. (22) “Of course it is Saturday night, Peter,” Wendy said, relenting. (23) “People of our figure, Wendy!”

“But it is only among our own progeny.”



“True, true.”



So they were told they could dance, but they must put on their nighties first. (24) “Ah, old lady,” Peter said aside to Wendy, warming himself by the fire and looking down at her as she sat turning a heel, “there is nothing more pleasant of an evening for you and me when the day’s toil is over than to rest by the fire with the little ones near by.”



“It is sweet, Peter, isn’t it?” Wendy said, frightfully gratified. (25) “Peter, I think Curly has your nose.”

“Michael takes after you.”



She went to him and put her hand on his shoulder.



