Paragraph: (1) "Didn't you feel dreadfully when the first cut came?". (2) asked Meg, with a shiver. (3) "I took a last look at my hair while the man got his things, and that was the end of it. (4) I never snivel over trifles like that; I will confess, though, I felt queer when I saw the dear old hair laid out on the table, and felt only the short, rough ends on my head. (5) It almost seemed as if I'd an arm or a leg off. (6) The woman saw me look at it, and picked out a long lock for me to keep. (7) I'll give it to you, Marmee, just to remember past glories by; for a crop is so comfortable I don't think I shall ever have a mane again.". (8) Mrs. March folded the wavy, chestnut lock, and laid it away with a short gray one in her desk. (9) She only said "Thank you, deary," but something in her face made the girls change the subject, and talk as cheerfully as they could about Mr. Brooke's kindness, the prospect of a fine day to-morrow, and the happy times they would have when father came home to be nursed. (10) No one wanted to go to bed, when, at ten o'clock, Mrs. March put by the last finished job, and said, "Come, girls.". (11) Beth went to the piano and played the father's favorite hymn; all began bravely, but broke down one by one, till Beth was left alone, singing with all her heart, for to her music was always a sweet consoler. (12) "Go to bed and don't talk, for we must be up early, and shall need all the sleep we can get. (13) Good-night, my darlings," said Mrs. March, as the hymn ended, for no one cared to try another. (14) They kissed her quietly, and went to bed as silently as if the dear invalid lay in the next room. (15) Beth and Amy soon fell asleep in spite of the great trouble, but Meg lay awake, thinking the most serious thoughts she had ever known in her short life. (16) Jo lay motionless, and her sister fancied that she was asleep, till a stifled sob made her exclaim, as she touched a wet cheek,—



"Jo, dear, what is it? (17) Are you crying about father?". (18) "No, not now.". (19) "What then?". (20) "My—my hair!". (21) burst out poor Jo, trying vainly to smother her emotion in the pillow. (22) It did not sound at all comical to Meg, who kissed and caressed the afflicted heroine in the tenderest manner. (23) "I'm not sorry," protested Jo, with a choke. (24) "I'd do it again to-morrow, if I could. (25) It's only the vain, selfish part of me that goes and cries in this silly way.



