“It was a present from Marfa Petrovna,” answered Dounia. (3) “And a very expensive one!” added Pulcheria Alexandrovna. (4) “A-ah! (5) What a big one! (6) Hardly like a lady’s.”

“I like that sort,” said Dounia. (7) “So it is not a present from herfiancé,” thought Razumihin, and was unreasonably delighted. (8) “I thought it was Luzhin’s present,” observed Raskolnikov. (9) “No, he has not made Dounia any presents yet.”

“A-ah! (10) And do you remember, mother, I was in love and wanted to get married?” he said suddenly, looking at his mother, who was disconcerted by the sudden change of subject and the way he spoke of it. (11) “Oh, yes, my dear.”

Pulcheria Alexandrovna exchanged glances with Dounia and Razumihin. (12) “H’m, yes. (13) What shall I tell you? (14) I don’t remember much indeed. (15) She was such a sickly girl,” he went on, growing dreamy and looking down again. (16) “Quite an invalid. (17) She was fond of giving alms to the poor, and was always dreaming of a nunnery, and once she burst into tears when she began talking to me about it. (18) Yes, yes, I remember. (19) I remember very well. (20) She was an ugly little thing. (21) I really don’t know what drew me to her then—I think it was because she was always ill. (22) If she had been lame or hunchback, I believe I should have liked her better still,” he smiled dreamily. (23) “Yes, it was a sort of spring delirium.”

“No, it was not only spring delirium,” said Dounia, with warm feeling. (24) He fixed a strained intent look on his sister, but did not hear or did not understand her words.



