Paragraph: (1) Foolish Tootles was standing like a conqueror over Wendy’s body when the other boys sprang, armed, from their trees. (2) “You are too late,” he cried proudly, “I have shot the Wendy. (3) Peter will be so pleased with me.”

Overhead Tinker Bell shouted “Silly ass!” and darted into hiding. (4) The others did not hear her. (5) They had crowded round Wendy, and as they looked a terrible silence fell upon the wood. (6) If Wendy’s heart had been beating they would all have heard it. (7) Slightly was the first to speak. (8) “This is no bird,” he said in a scared voice. (9) “I think this must be a lady.”

“A lady?” said Tootles, and fell a-trembling. (10) “And we have killed her,” Nibs said hoarsely. (11) They all whipped off their caps. (12) “Now I see,” Curly said: “Peter was bringing her to us.” He threw himself sorrowfully on the ground. (13) “A lady to take care of us at last,” said one of the twins, “and you have killed her!”



They were sorry for him, but sorrier for themselves, and when he took a step nearer them they turned from him. (14) Tootles’ face was very white, but there was a dignity about him now that had never been there before. (15) “I did it,” he said, reflecting. (16) “When ladies used to come to me in dreams, I said, ‘Pretty mother, pretty mother.’ But when at last she really came, I shot her.”



He moved slowly away. (17) “Don’t go,” they called in pity. (18) “I must,” he answered, shaking; “I am so afraid of Peter.”



It was at this tragic moment that they heard a sound which made the heart of every one of them rise to his mouth. (19) They heard Peter crow.

