Paragraph: (1) One day he lost sight of his retinue in a great forest. (2) These forests are very useful in delivering princes from their courtiers, like a sieve that keeps back the bran. (3) Then the princes get away to follow their fortunes. (4) In this way they have the advantage of the princesses, who are forced to marry before they have had a bit of fun. (5) I wish our princesses got lost in a forest sometimes. (6) One lovely evening, after wandering about for many days, he found that he was approaching the outskirts of this forest; for the trees had got so thin that he could see the sunset through them; and he soon came upon a kind of heath. (7) Next he came upon signs of human neighbourhood; but by this time it was getting late, and there was nobody in the fields to direct him. (8) After travelling for another hour, his horse, quite worn out with long labour and lack of food, fell, and was unable to rise again. (9) So he continued his journey on foot. (10) At length he entered another wood—not a wild forest, but a civilized wood, through which a footpath led him to the side of a lake. (11) Along this path the prince pursued his way through the gathering darkness. (12) Suddenly he paused, and listened. (13) Strange sounds came across the water. (14) It was, in fact, the princess laughing. (15) Now there was something odd in her laugh, as I have already hinted; for the hatching of a real hearty laugh requires the incubation of gravity; and perhaps this was how the prince mistook the laughter for screaming. (16) Looking over the lake, he saw something white in the water; and, in an instant, he had torn off his tunic, kicked off his sandals, and plunged in. (17) He soon reached the white object, and found that it was a woman. (18) There was not light enough to show that she was a princess, but quite enough to show that she was a lady, for it does not want much light to see that. (19) Now I cannot tell how it came about,—whether she pretended to be drowning, or whether he frightened her, or caught her so as to embarrass her,—but certainly he brought her to shore in a fashion ignominious to a swimmer, and more nearly drowned than she had ever expected to be; for the water had got into her throat as often as she had tried to speak. (20) At the place to which he bore her, the bank was only a foot or two above the water; so he gave her a strong lift out of the water, to lay her on the bank. (21) But, her gravitation ceasing the moment she left the water, away she went up into the air, scolding and screaming. (22) "You naughty, naughty, NAUGHTY, NAUGHTY man!". (23) she cried. (24) No one had ever succeeded in putting her into a passion before. (25) When the prince saw her ascend, he thought he must have been bewitched, and have mistaken a great swan for a lady. (26) But the princess caught hold of the topmost cone upon a lofty fir.



