p, and throw something into the water. (17) And what if the boxes were to float instead of sinking? (18) And of course they would. (19) Even as it was, everyone he met seemed to stare and look round, as if they had nothing to do but to watch him. (20) “Why is it, or can it be my fancy?” he thought. (21) At last the thought struck him that it might be better to go to the Neva. (22) There were not so many people there, he would be less observed, and it would be more convenient in every way, above all it was further off. (23) He wondered how he could have been wandering for a good half-hour, worried and anxious in this dangerous past without thinking of it before. (24) And that half-hour he had lost over an irrational plan, simply because he had thought of it in delirium!



