Book Title: Peter Pan

Book Author: J. M. Barrie

Paragraph: (1) But she was a young mother and she did not know this; she thought you simply must stick to your rule about half an hour after the mid-day meal. (2) So, though fear was upon her, and she longed to hear male voices, she would not waken them. (3) Even when she heard the sound of muffled oars, though her heart was in her mouth, she did not waken them. (4) She stood over them to let them have their sleep out. (5) Was it not brave of Wendy? (6) It was well for those boys then that there was one among them who could sniff danger even in his sleep. (7) Peter sprang erect, as wide awake at once as a dog, and with one warning cry he roused the others. (8) He stood motionless, one hand to his ear. (9) “Pirates!” he cried. (10) The others came closer to him. (11) A strange smile was playing about his face, and Wendy saw it and shuddered. (12) While that smile was on his face no one dared address him; all they could do was to stand ready to obey. (13) The order came sharp and incisive. (14) “Dive!”

There was a gleam of legs, and instantly the lagoon seemed deserted. (15) Marooners’ Rock stood alone in the forbidding waters as if it were itself marooned. (16) The boat drew nearer. (17) It was the pirate dinghy, with three figures in her, Smee and Starkey, and the third a captive, no other than Tiger Lily. (18) Her hands and ankles were tied, and she knew what was to be her fate. (19) She was to be left on the rock to perish, an end to one of her race more terrible than death by fire or torture, for is it not written in the book of the tribe that there is no path through water to the happy hunting-ground? (20) Yet her face was impassive; she was the daughter of a chief, she must die as a chief’s daughter, it is enough. (21) They had caught her boarding the pirate ship with a knife in her mouth. (22) No watch was kept on the ship, it being Hook’s boast that the wind of his name guarded the ship for a mile around. (23) Now her fate would help to guard it also. (24) One more wail would go the round in that wind by night. (25) In the gloom that they brought with them the two pirates did not see the rock till they crashed into it.



