Paragraph: (1) In a few moments, his hand was on his arm. (2) “Dorian! (3) What an extraordinary piece of luck! (4) I have been waiting for you in your library ever since nine o’clock. (5) Finally I took pity on your tired servant and told him to go to bed, as he let me out. (6) I am off to Paris by the midnight train, and I particularly wanted to see you before I left. (7) I thought it was you, or rather your fur coat, as you passed me. (8) But I wasn’t quite sure. (9) Didn’t you recognize me?”

“In this fog, my dear Basil? (10) Why, I can’t even recognize Grosvenor Square. (11) I believe my house is somewhere about here, but I don’t feel at all certain about it. (12) I am sorry you are going away, as I have not seen you for ages. (13) But I suppose you will be back soon?”

“No: I am going to be out of England for six months. (14) I intend to take a studio in Paris and shut myself up till I have finished a great picture I have in my head. (15) However, it wasn’t about myself I wanted to talk. (16) Here we are at your door. (17) Let me come in for a moment. (18) I have something to say to you.”

“I shall be charmed. (19) But won’t you miss your train?” said Dorian Gray languidly as he passed up the steps and opened the door with his latch-key. (20) The lamplight struggled out through the fog, and Hallward looked at his watch. (21) “I have heaps of time,” he answered. (22) “The train doesn’t go till twelve-fifteen, and it is only just eleven. (23) In fact, I was on my way to the club to look for you, when I met you. (24) You see, I shan’t have any delay about luggage, as I have sent on my heavy things. (25) All I have with me is in this bag, and I can easily get to Victoria in twenty minutes.”



Dorian looked at him and smiled.



