Paragraph: (1) He disguised himself, and, going to the palace, requested to see the lord chamberlain. (2) His appearance at once gained his request; and the lord chamberlain, being a man of some insight, perceived that there was more in the prince's solicitation than met the ear. (3) He felt likewise that no one could tell whence a solution of the present difficulties might arise. (4) So he granted the prince's prayer to be made shoeblack to the princess. (5) It was rather cunning in the prince to request such an easy post, for the princess could not possibly soil as many shoes as other princesses. (6) He soon learned all that could be told about the princess. (7) He went nearly distracted; but after roaming about the lake for days, and diving in every depth that remained, all that he could do was to put an extra polish on the dainty pair of boots that was never called for. (8) For the princess kept her room, with the curtains drawn to shut out the dying lake, But she could not shut it out of her mind for a moment. (9) It haunted her imagination so that she felt as if the lake were her soul, drying up within her, first to mud, then to madness and death. (10) She thus brooded over the change, with all its dreadful accompaniments, till she was nearly distracted. (11) As for the prince, she had forgotten him. (12) However much she had enjoyed his company in the water, she did not care for him without it. (13) But she seemed to have forgotten her father and mother too. (14) The lake went on sinking. (15) Small slimy spots began to appear, which glittered steadily amidst the changeful shine of the water. (16) These grew to broad patches of mud, which widened and spread, with rocks here and there, and floundering fishes and crawling eels swarming. (17) The people went everywhere catching these, and looking for anything that might have dropped from the royal boats. (18) At length the lake was all but gone, only a few of the deepest pools remaining unexhausted. (19) It happened one day that a party of youngsters found themselves on the brink of one of these pools in the very centre of the lake. (20) It was a rocky basin of considerable depth. (21) Looking in, they saw at the bottom something that shone yellow in the sun. (22) A little boy jumped in and dived for it. (23) It was a plate of gold covered with writing. (24) They carried it to the king.

